import "./booklist.css"
import axios from "axios"
import { useState } from "react"
import { useEffect } from "react";

export default function TopBar() {
    const [user, setUser] = useState([]);
    useEffect(()=>{
        const fetchUser = async () => {
            const res = await axios.get("/books")
            // setUser(res.data)
            console.log("hello", res);
            setUser(res.data)

        }
        fetchUser();
    },[] )
  return (
    <div>

      
    <div>
   
      <table> 
        <thead>
        <tr>
          <th colSpan="4">Book List</th>
        </tr>
        <tr>
          <th>Book Name</th>
          <th>Author</th>
          <th>Edition</th>
          <th>price</th>
          <th>Copyright</th>
          <th>Title</th>
          <th>Description</th>
         
        </tr>
        </thead>
        {user.map((c) => (
          <tr> 
          <td>{c.bookname}</td>
          <td>{c.author}</td>
          <td>{c.edition}</td>
          <td>{c.price}</td>
          <td>{c.copyright}</td>
          <td>{c.title}</td>
          <td>{c.desc}</td>
         
         
      
         
        
          </tr>
        
      
     

      ))}
      </table>
    </div>
  
    </div>
  )

  
}
